import React from 'react';
import { Card } from 'semantic-ui-react'

const locationCard = ({weatherData}) => (
  <Card>
    <Card.Content>
        <Card.Header className="header">{weatherData.name}</Card.Header>
    </Card.Content>
  </Card>
)

export default locationCard;
